        Pulumi.run(App::stack);
    }

    public static void stack(Context ctx) {
        var schema = new ConnectorSchemaConfig("schema", ConnectorSchemaConfigArgs.builder()        
            .connectorId("connector_id")
            .schemas(            
                ConnectorSchemaConfigSchemaArgs.builder()
                    .name("schema_name")
                    .tables(                    
                        ConnectorSchemaConfigSchemaTableArgs.builder()
                            .column(                            
                                %!v(PANIC=Format method: runtime error: invalid memory address or nil pointer dereference),
                                %!v(PANIC=Format method: runtime error: invalid memory address or nil pointer dereference))
                            .name("table_name")
                            .build(),
                        ConnectorSchemaConfigSchemaTableArgs.builder()
                            .name("enabled_table_name")
                            .build())
                    .build(),
                ConnectorSchemaConfigSchemaArgs.builder()
                    .name("enabled_schema_name")
                    .build())
            .schemaChangeHandling("ALLOW_COLUMNS")
            .build());

    }
