```
```yaml
resources:
  schema:
    type: fivetran:ConnectorSchemaConfig
    properties:
      connectorId: connector_id
      schemas:
        - name: schema_name
          tables:
            - column:
                - hashed: 'true'
                  name: hashed_column_name
                - enabled: 'false'
                  name: disabled_columns_name
              name: table_name
